        {
          x: "moto",
          y: 254,
        },
        {
          x: "bicycle",
          y: 261,
        },
        {
          x: "horse",
          y: 29,
        },
        {
          x: "skateboard",
          y: 272,
        },
        {
          x: "others",
          y: 208,
        },
      ],
    },
    {
      id: "us",
      color: "hsl(111, 70%, 50%)",
      data: [
        {
          x: "plane",
          y: 263,
        },
        {
          x: "helicopter",
          y: 294,
        },
        {
          x: "boat",
          y: 138,
        },
        {
          x: "train",
          y: 25,
        },
        {
          x: "subway",
