        {
          x: "horse",
          y: 19,
        },
        {
          x: "skateboard",
          y: 222,
        },
        {
          x: "others",
          y: 219,
        },
      ],
    },
    {
      id: "germany",
      color: "hsl(159, 70%, 50%)",
      data: [
        {
          x: "plane",
          y: 65,
        },
        {
          x: "helicopter",
          y: 85,
        },
        {
          x: "boat",
