        {
          x: "skateboard",
          y: 173,
        },
        {
          x: "others",
          y: 229,
        },
      ],
    },
    {
      id: "norway",
      color: "hsl(287, 70%, 50%)",
      data: [
        {
          x: "plane",
          y: 29,
        },
        {
          x: "helicopter",
          y: 291,
        },
        {
          x: "boat",
          y: 38,
        },
        {
          x: "train",
          y: 146,
        },
        {
          x: "subway",
          y: 234,
        },
        {
          x: "bus",
          y: 69,
